import React from 'react';
import './styles.css';
const Header = () => {
    return (
        <header className="bg-70259B px-4 py-4 flex justify-between items-center">
            <div className="mr-4">
                <img src="assets/logo.svg" alt="Logo" />
            </div>

            <nav className="flex space-x-4">
                <a href="#" className="text-white hover:text-gray-200">Item 1</a>
                <a href="#" className="text-white hover:text-gray-200">Item 2</a>
                <a href="#" className="text-white hover:text-gray-200">Item 3</a>
                <a href="#" className="text-white hover:text-gray-200">Item 4</a>
            </nav>

            <button className="bg-white text-70259B font-bold py-2 px-4 rounded-md shadow hover:bg-gray-200 focus:outline-none">Let's Talk</button>
        </header>
    );
};

export default Header;
